●スピードシェービングで肌へのダメージを抑えるシェーバーに洗浄充電器、トリマーが付属したモデルです。<BR>●マルチプレシジョン刃はすべてのヒゲを起こしてカットするため、少ないストロークでシェービングが完了します。<BR>●5方向に自在に動くシェービングヘッドが顔の起伏にスキなく密着し、素早い深剃りを実現します。<BR>●ターボモードをONにすると、通常より10％回転数がアップし、早剃りを実現します。<BR>●ドライ剃りにもウェット剃り（お風呂シェーブ）にも対応しています。<BR>●ボタンを押すだけで、スマートクリーン（洗浄充電器）がシェーバーの洗浄、乾燥、潤滑化、充電までを行います。<BR>●大きめサイズのトリマーはもみあげなどを素早く整えることができます。<BR>●3段階充電残量表示など、分かりやすいディスプレイには、各種情報が表示され、シェーバーの理想的なパフォーマンスを引き出します。<BR>●シェーバーの上部を開き、水洗いするだけでお手入れできます。<br>●刃数／27枚<BR>●駆動方式／回転式<BR>●洗浄方法／水洗い<BR>●色／ブラック/レッド<BR>●充電時間／1時間<BR>●使用時間／約50分<BR>●電源／リチウムイオンバッテリー<BR>●電源方式／充電式<BR>●寸法／W61×D67×H164mm<BR>●質量／173g<BR>●付属品／充電アダプタ、収納ケース、スタンド、洗浄充電器、クリーニングカートリッジ、トリマー、取扱説明書<BR>●保証期間／2年<br>●メーカー／フィリップス<br>●型番／S5395/26<br>●JANコード／8710103791447<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<br><br>※本商品はメーカーより取寄せ後の発送となるため、配送日はご指定頂けません。予めご了承ください。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

