●やさしさと深剃りを極めたシェーバーに洗浄充電器、ヒゲスタイラ―、洗顔ブラシが付属したモデルです。<BR>●ダブルV トラック刃は、ヒゲの一本一本を最適なカット位置にやさしくガイド、平らに寝た長さの異なるヒゲも逃しません。より少ないストロークで、なめらかな肌に仕上げます。<BR>●8方向に可動する輪郭検知ヘッドで顔や首のどんな凹凸にも密着します。<BR>●お好みに合わせて3段階のスピードに調整できます。<BR>●ドライ剃りにもウェット剃り（お風呂シェーブ）にも対応しています。<BR>●ボタンを押すだけで、スマートクリーン（洗浄充電器）がシェーバーの洗浄、乾燥、潤滑化、充電までを行います。<BR>●ヒゲスタイラ―はヒゲの長さをミリ単位で調整ができます。<BR>●洗顔ブラシは古い角質を取り除き、輝く肌に洗い仕上げます。<BR>●3桁充電残量表示など、分かりやすいディスプレイには、各種情報が表示され、シェーバーの理想的なパフォーマンスを引き出します。<BR>●シェーバーの上部を開き、水洗いするだけでお手入れできます。<br>●刃数／72枚<BR>●駆動方式／回転式<BR>●洗浄方法／水洗い<BR>●色／ブラック/シルバー<BR>●充電時間／1時間<BR>●使用時間／約60分<BR>●電源／リチウムイオンバッテリー<BR>●電源方式／充電式<BR>●寸法W59×D70×H164mm<BR>●質量／169g<BR>●付属品／充電アダプタ、収納ケース、スタンド、保持版ホルダー、洗浄充電器、クリーニングカートリッジ、ヒゲスタイラ―、洗顔ブラシ・洗顔ブラシ保護キャップ、取扱説明書<BR>●保証期間／2年<br>●メーカー／フィリップス<br>●型番／S9732/33<br>●JANコード／8710103782483<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<br><br>※本商品はメーカーより取寄せ後の発送となるため、配送日はご指定頂けません。予めご了承ください。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

