電池が切れた時にはコードを繋いでも使える、充電/交流両用式です。ポップアップトリマーがついているので、剃りにくいクセヒゲを剃るときや、モミアゲのお手入れに便利です。充電時間はわずか約1時間と、急速充電が可能です。また自動電圧切替機能により、アメリカ、カナダ、グアムなどのA2プラグ地域であれば海外でも使用可能です。防水設計なので、本体丸ごと水洗いが可能です。充電中、充電完了をLEDで表示します。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">電池が切れた時にはコードを繋いでも使える、充電/交流両用式です。ポップアップトリマーがついているので、剃りにくいクセヒゲを剃るときや、モミアゲのお手入れに便利です。充電時間はわずか約1時間と、急速充電が可能です。また自動電圧切替機能により、アメリカ、カナダ、グアムなどのA2プラグ地域であれば海外でも使用可能です。防水設計なので、本体丸ごと水洗いが可能です。充電中、充電完了をLEDで表示します。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">W6.2×D4.3×H15.7cm</font><br><font color="#333333" size="-1">個装サイズ：5×12×18cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約158g</font><br><font color="#333333" size="-1">個装重量：315g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ABS</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">電源:充電/交流 両用式(AC100-240V・50/60Hz)<br>充電コード長さ:1.8m<br>蓄電池:Ni-MH<br>充電時間:急速約1時間<br>使用日数:約8日※<br>刃の動作方式:往復式<br>防水設計:IPX7基準<br>海外対応:AC100-240V 自動電圧切替(A2プラグ地域)<br>■機能■<br>3枚刃<br>1LED表示(充電中/充電完了)<br>ポップアップ トリマー<br>スリムボディ デザイン<br>本体丸洗い可<br>低振動、低騒音設計<br>外刃独立上下フロート<br>大型電源スイッチ<br><br>※満充電状態で、1日1回約3分間使用した場合の使用可能日数。</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">掃除用ブラシ<br>キャップ<br>取扱説明書<br>保証書(1年)</font></td></tr><tr bgcolor="#FFFFFF